import React, { Fragment } from 'react';
import "./styles.css";
import { Container, Row, Col, Card, CardBody, CardHeader } from "reactstrap";


const AddNewSocialMediaLinksHackerHelper = (props) => {
    return (
        <Fragment>
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <Card className='shadow'>
                            <CardHeader className='b-l-primary b-r-primary'>
                                <h3>Enter your 'social' links <strong>(social media)</strong>, enter as many or few as you'd like however we recommend adding them all</h3>
                                <p>Enter your social media links/accounts to better populate your public account information so other user's can check-out your relevant work history and/or previous projects or work..</p>
                            </CardHeader>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default AddNewSocialMediaLinksHackerHelper;
